import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import "./CSS/navBar.css";
import PIC from "../images/shopping-cart-icon-illustration-free-vector.webp";

export default function NavBar() {
  const myState = useSelector((state) => state.savingData);

  return (
    <>
      <div>
        <div
          style={{ backgroundColor: "skyBlue", width: "100%", margin: "0%" }}
        >
          <p style={{ textAlign: "center" }}>
            Super Deal ! Shop Over 10 Ether And Get 1 Ether Coupen
          </p>
        </div>
        <div
          style={{
            height: "50px",
            width: "94%",
            border: "2px solid black",
            display: "block",
            margin: "auto",
            borderRadius: "10px",
          }}
        >
          <ul style={{ display: "flex", justifyContent: "center" }}>
            <Link
              className="returnLi"
              style={{
                marginLeft: "0%",
                listStyle: "none",
                textDecoration: "none",
                color: "black",
              }}
              to="/"
            >
              Home
            </Link>
            <Link
              className="returnLi"
              style={{
                marginLeft: "5%",
                listStyle: "none",
                textDecoration: "none",
                color: "black",
              }}
              to="/mensClothing"
            >
              Men's Clothing
            </Link>
            <Link
              className="returnLi"
              style={{
                marginLeft: "5%",
                listStyle: "none",
                textDecoration: "none",
                color: "black",
              }}
              to="/womensClothing"
            >
              Women's Clothing
            </Link>
            <Link
              className="returnLi"
              style={{
                marginLeft: "5%",
                listStyle: "none",
                textDecoration: "none",
                color: "black",
              }}
              to="/jeweleries"
            >
              Jeweleries
            </Link>
            <Link
              className="returnLi"
              style={{
                marginLeft: "5%",
                listStyle: "none",
                textDecoration: "none",
                color: "black",
              }}
              to="/electronics"
            >
              Electronics
            </Link>
          </ul>
        </div>

        <div style={{ display: "flex", justifyContent: "center" }}>
          <h1 style={{ textAlign: "center" }}>Cart Items</h1>
          <img
            src={PIC}
            alt="noImage"
            style={{ height: "80px", width: "90px" }}
          />
          <p
            style={{
              backgroundColor: "black",
              color: "white",
              width: "20px",
              height: "20px",
              borderRadius: "10px",
              textAlign: "center",
            }}
          >
            1
          </p>
        </div>

        <div
          style={{
            height: "100%",
            width: "94%",
            display: "flex",
            flexWrap: "wrap",
            margin: "auto",
          }}
        >
          {myState.rj.map((d, i) => {
            return (
              <div key={i} style={{ marginLeft: "3%", marginTop: "1%" }}>
                <img
                  src={d.image}
                  alt="noImage"
                  style={{ height: "100px", width: "100px" }}
                />
              </div>
            );
          })}
        </div>
        <hr />
      </div>
    </>
  );
}
